import React, { useEffect, useState } from "react";

const App = () => {
  const [num, setNum] = useState(0);

  useEffect(() => {
    alert()
  });

  return (
    <button
      onClick={
        (() => {
          setNum(num + 1);
        },
        () => {
          alert("I am clicked");
        })
      }
    >
      Click Me {num}
    </button>
  );
};

export default App;
